/**
 * @internal
 * initialize the container with functions or wrappers
 */
void
_vehicleDetectorTable_container_init(vehicleDetectorTable_interface_ctx *if_ctx)
{

    DEBUGMSGTL(("internal:vehicleDetectorTable:_vehicleDetectorTable_container_init","called\n"));
    log_debug(" \n CONTAINER INIT  INTERFACE.C_2336 \n ");
    /*
     * cache init
     */
    if_ctx->cache = netsnmp_cache_create(30, /* timeout in seconds */
                                         _cache_load, _cache_free,
                                         vehicleDetectorTable_oid,
                                         vehicleDetectorTable_oid_size);

    if(NULL == if_ctx->cache) {
        snmp_log(LOG_ERR, "error creating cache for vehicleDetectorTable\n");
        return;
    }

    if_ctx->cache->flags = NETSNMP_CACHE_DONT_INVALIDATE_ON_SET;

    vehicleDetectorTable_container_init(&if_ctx->container, if_ctx->cache);
    if(NULL == if_ctx->container) {
        if_ctx->container = netsnmp_container_find("vehicleDetectorTable:table_container");
        if(NULL != if_ctx->container) {
            /*
             * When reporting container management errors, we log the container's
             * name, so set it here.
             */
            if_ctx->container->container_name = strdup("vehicleDetectorTable");
        }
    }
    if(NULL == if_ctx->container) {
        snmp_log(LOG_ERR,"error creating container in "
                 "vehicleDetectorTable_container_init\n");
                 log_debug(" \n if NULL CONTAINER INIT  INTERFACE.C_2366 \n ");
        return;
    }

    if (NULL != if_ctx->cache)
        if_ctx->cache->magic = (void*)if_ctx->container;
} /* _vehicleDetectorTable_container_init */

